import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { NavLink } from "react-router-dom";
import { Navigate, useNavigate } from "react-router-dom";
import Container from "react-bootstrap/Container";
import NavDropdown from "react-bootstrap/NavDropdown";
import { useState } from "react";
// import { ToastContainer, toast } from "react-toastify";
import toast, { Toaster } from 'react-hot-toast';

export default function Header() {
  const navigate = useNavigate();
  const [isLoggedIn, setisLoggedIn] = useState();

  const logOut = () => {
    navigate("/login");
    //   setCookie('token', '0')
    setisLoggedIn(false);
  };

  const handleLinkClick = () => {
    toast.success("Linked clicked!", {
      position: toast.POSITION.TOP_CENTER,
      theme: "colored",
      autoClose: 5000,
      onClose: () => {
        navigate("/");
      },
    });
  };

  // const token = (getCookie('token'));
  return (
    <div>
      <Toaster />
      <Navbar>
        <Container>
          <NavLink className="navbar-brand" to="/login">
            <img
              style={{ width: 40 + "%" }}
              src="https://cdn5.dcbstatic.com/files/c/o/codeboxx_docebosaas_com/userfiles/13037/codebloggs_logo2.png"
            ></img>
          </NavLink>
          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <NavDropdown title="Menu" id="navbarScrollingDropdown">
            <NavDropdown.Item href="#action3" onClick={handleLinkClick}>
              Account Settings
            </NavDropdown.Item>

            <NavDropdown.Item href="#action4" onClick={logOut}>
              Logout
            </NavDropdown.Item>
          </NavDropdown>
          {/* <ToastContainer /> */}
        </Container>
      </Navbar>
    </div>
  );
}
